'undefined') {\n    var id = data['id'][inds];\n    for ( i = 0; i < allfilters.length; i++) {\n        loadNewImage(allfilters[i],id);\n    }\n    var filt = filters.data;\n    var filt_f = filters_flux.data;\n    var mags = [16,28];\n    for (i = 0; i < filt['wav'].length; i++) {\n        var key = filt['key'][i];\n        var mag = data[key.toLowerCase() + '_vega'][inds];\n        var rate = data[key.toLowerCase() + '_rate'][inds];\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        filt['mag'][i] = mag;\n        filt['rates'][i] = rate;\n        if ((key != 'F625W') && (key != 'F658N')) {\n            var k = i;\n            if (i > 2) { k = i - 2; }\n            for (j = 0; j < stats.length; j++) {\n                var detector;\n                if ((key == 'F475W') || (key == 'F814W')) {\n                    detector = 'ACS_WFC';\n                } else {\n                    detector = 'WFC3';\n                }\n                var flux_nd = data['logHST_' + detector + '_' + key + '_nd_' + stats[j]][inds];\n                var flux_wd = data['logHST_' + detector + '_' + key + '_wd_' + stats[j]][inds];\n                filt_f['flux_nd_'+stats[j]][k] = flux_nd;\n                filt_f['flux_wd_'+stats[j]][k] = flux_wd;\n            }\n        }\n    }\n    filters.trigger('change');\n    filters_flux.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag < 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag > 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"2bd47be2-ca31-4bda-8a62-d92a308dffeb"
